import React from "react";
import { useState } from "react";

const StreamText = ({ value, setValue }) => {
    return (
        <div>
            <input type="text" onInput={(e) => setValue(e.target.value)} />
            <h1>{value}</h1>
        </div>
    )
}

export default StreamText
